import React from "react";

function Todo(props) {

    return (
        <div className='todo' key={props.todo.id}>
            <span className='todo-number'>{props.todo.id}</span>
            <span className='todo-text'>{props.todo.text}</span>
            <div className='todo-buttons'>
                <button>Delete Todo</button>
                <button>Edit a todo</button>
            </div>
        </div>
    )
}

export default Todo
